import React, { Component } from 'react';

import {
    Alert, Container, Row, Col,
    Card, CardHeader, CardBody, CardText, CardTitle, CardFooter,
    Form, FormGroup, Label, Input, FormText, Button, CustomInput
} from 'reactstrap';

class Control extends Component {
    render() {
        return (
            <Row>
                <Col md="5">
                    <FormGroup>
                        <Label for="searchword" hidden>Tìm kiếm</Label>
                        <Input type="text" name="searchword" id="searchword" placeholder="" />
                        <Button color="primary">Tìm</Button>
                    </FormGroup>
                </Col>
                <Col md="1">

                </Col>
            </Row>
        );
    }
}

export default Control;
